			self.Y_scroll_delta = 0
			self.Spacing = 2
			self.Padding = 0
		end

		function GUI:SetPadding(num) -- Padding is the idents around the panels
			self.Padding = num
			self:PerformOrganization()
		end

		function GUI:SetSpacing(num) -- The spacing in-between panels
