		-- This is my automated way of fetching and finding shared modules pf uses
		-- How to access -> BBOT.aux.replication
		local aux_tables = {
			["vector"] = {"random", "anglesyx"},
			["animation"] = {"player", "reset"},
			["gamelogic"] = {"controllerstep", "setsprintdisable"},
