					fov_outline.Radius = fov.Radius
					dzfov.Radius = _dzfov / camera.FieldOfView  * yport
					dzfov_outline.Radius = dzfov.Radius
					sfov.Radius = _sfov / camera.FieldOfView  * yport
					sfov_outline.Radius = sfov.Radius

