					uniqueid = uid,
					player = player,
					players = players,
					controller = controller,
					parent = workspace.Players,
					timesdestroyed = 0,
				}, self.player_meta)
				self:Remove(uid)
				self:Add(esp_controller)

				log(LOG_DEBUG, "Player ESP: Created ", player.Name)
				return esp_controller
			end

