						v[2].Visible = false
						lastframe = framedata
						continue
					end
					v[1].Visible = true
					v[2].Visible = true
					v[1].From = Vector2.new(point1.X, point1.Y)
					v[1].To = Vector2.new(point2.X, point2.Y)
					v[2].From = Vector2.new(point1.X, point1.Y)
					v[2].To = Vector2.new(point2.X, point2.Y)
					lastframe = framedata
				end
